import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import { Container, Grid } from '@material-ui/core';

const useStyles = makeStyles({

    root: {
        maxWidth: "90%",
        padding: '2%'
    },


    Title: {
        textAlign: 'center',
        marginTop: '2%'

    },

    ptin:{
        float:'right',
        // marginBotom:'25
        clear:"both"

    },
    btn:{
        justifyContent:'center'
    },
    btnRight:{
        float:"right"
    }

});


export default function CitizenDetail({ userData }) {
    const classes = useStyles();
    console.log(userData, "propaaaa")
    return (
        <Container  >

            <Typography className={classes.Title} variant="h4">Property Details</Typography>
            <Grid container spacing={12} justify="center">

                <Grid item xs={12} md={8} >
                    <Card className={classes.root}>
                        <CardActionArea>
                            <CardContent>
                            <Typography className={classes.ptin} gutterBottom variant="h5" component="h2">
                                    {userData.PTIN}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.Financial_Year}
                                </Typography>

                                <Typography gutterBottom variant="h5" component="h2">
                                Owner Name :   {userData.Owner_Name}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                House No. :  {userData.House_No} {userData.Zone}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                Locality:   {userData.Locality}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                Property Type :   {userData.Property_type}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                Last Payment Date :   {userData.Last_Payment_Date}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                Total Paid Amount:   {userData.Total_Paid_Amount}
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                        <CardActions className={classes.btn}>
                        <Button variant="contained" color="primary" >
                            Send Request
                    </Button>
                        <Button variant="contained" color="secondary" className={classes.btnRight}>
                            Edit Detail
                    </Button>
                        </CardActions>
                    </Card>
                </Grid>


            </Grid>
        </Container>

    );
}














